import React from "react";
import { Link } from "react-router-dom";

function Image(props) {
  return (
    <>
      <Link className="img-wrap" to={props.path}>
        <img className="image-img" alt="project" src={props.src} />
      </Link>
    </>
  );
}

export default Image;
